	add("sincipita", "{\"term\":\"sincipita\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"First attested in 1847; from the Latin \u0027sincipita\u0027 the nominative plural form of \u0027sinciput\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1847\u0027\u0027, \u0027Journal of w:The Asiatic the Asiatic Society of Bengal\u0027 XVI:ii, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003diAfgAAAAMAAJ\u0026amp;pg\u003dPA734\u0026amp;dq\u003d%2Bsincipita\u0026amp;hl\u003den\u0026amp;ei\u003debaZTtILhKHxA8DP1MMF\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CDUQ6AEwA\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%2Bsincipita\u0026amp;f\u003dfalse page 734]\u0026lt;/span\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Of the three very small specimens, the youngest is entirely of a bright light fulvous hue, without any admixture of dark hairs: the second has a general slight admixture of dark hairs, which predominate on the forehead, vertex, and occiput, while the \u0027\u0027sincipita\u0027\u0027 continue bright fulvous; the arms and hands, knees, shins, and feet, are as dark as in the adult: the third, but very little larger, is coloured as in the mature animal, except that the terminal three-fourths of its tail continue rufous; and some admixture of the same remains on the \u0027\u0027sincipita\u0027\u0027, throat, flanks, and exterior of thighs\", \"priority\":3}]}, \"synonyms\":{}}");

	add("sinciput", "{\"term\":\"sinciput\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From the Latin \u0027sinciput\u0027 (half a head”; “smoked hog’s cheek \u0027or\u0027 half-jowl”; {{qualifier) “brain”, “head|lang\u003dla}}, whence the French \u0027sinciput\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of the or (as from the\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027, \u0027International Abstracts of Surgery\u0027, Volume 119, [http://books.google.com/books?id\u003dI9MhAQAAMAAJ\u0026amp;q\u003d%22sinciput%7Csinciputs%22+-intitle:%22%22\u0026amp;dq\u003d%22sinciput%7Csinciputs%22+-intitle:%22%22\u0026amp;hl\u003den\u0026amp;ei\u003dw9WeTqGcLc6rsALm8LzuCQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CCsQ6AEwADh4 page 629\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The cranial anomalies occurred either in the occiput or the \u0027\u0027sinciput\u0027\u0027, approximately twice as often in the occiput as in the \u0027\u0027sinciput\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Such lesions have been considered to be inoperable when they involved the \u0027\u0027sinciput\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Robert K. Creasy, \u0027Management of Labor and Delivery\u0027, [http://books.google.com/books?id\u003dYyAgYjRZhWEC\u0026amp;pg\u003dPA375\u0026amp;dq\u003d%22sinciput%22+-intitle:%22%22\u0026amp;hl\u003den\u0026amp;ei\u003d586eTtDKC5GOsAKGiqnICQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d7\u0026amp;ved\u003d0CEcQ6AEwBjg\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sinciput%22%20-intitle%3A%22%22\u0026amp;f\u003dfalse page 375\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Between these two extremes lie the \u0027\u0027sinciput\u0027\u0027 presentation and the brow presentation. Thus there are four distinct attitudes: vertex, \u0027\u0027sinciput\u0027\u0027, brow, and face (Figure 15-7\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Sara Wickham, \u0027Midwifery: Best Practice\u0027, Volume 1, [http://books.google.com/books?id\u003dPvRo4rJ1UEUC\u0026amp;pg\u003dPA79\u0026amp;dq\u003d%22sinciput%22+-intitle:%22%22\u0026amp;hl\u003den\u0026amp;ei\u003dYsqeTvLbCIetsAKdrpD-CQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d9\u0026amp;ved\u003d0CE0Q6AEwC\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sinciput%22%20-intitle%3A%22%22\u0026amp;f\u003dfalse page 79\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"I learnt to develop a ‘feel’ for the \u0027\u0027sinciput\u0027\u0027 and the occiput as these landmarks feel different abdominally, and also their ‘whereabouts’ in relationship to the pelvic brim. Therefore, when descent and flexion were taking place, I learnt to ascertain how the positions of the \u0027\u0027sinciput\u0027\u0027 and occiput would change in relationship to each other and in relationship to the pelvic brim\", \"priority\":10}]}, \"synonyms\":{}}");

