	add("sinew", "{\"term\":\"sinew\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"Avestan\", \"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"ancient greek (to 1453)\", \"Icelandic\", \"Latin\", \"Dutch\", \"Sanskrit\", \"scots\", \"saterfriesisch\", \"Swedish\", \"tokharian b\"], \"text\":\"From Middle english (1100-1500) \u0027sinewe\u0027 \u0027synow\u0027 \u0027sinue\u0027 from Old english (ca. 450-1100) \u0027sinu\u0027 \u0027synu\u0027 \u0027senu\u0027 \u0027seono\u0027 \u0027seonu\u0027 (sinew, nerve, tendon) from Proto-germanic {{m|gem-pro|*sinwō}}, {{m|gem-pro|*senawō||sinew}}, from Proto-indo-european {{m|ine-pro|*snḗh₁wr̥||sinew, tendon}}, from Proto-indo-european {{m|ine-pro|*(s)neh₁-||to twist (threads), spin, weave}}. Cognate with Scots \u0027senon\u0027 \u0027sinnon\u0027 \u0027sinnow\u0027 (sinew) Saterfriesisch \u0027siene\u0027 (sinew) West frisian \u0027senuw\u0027 \u0027sine\u0027 (nerve, sinew) Dutch \u0027zenuw\u0027 (nerve, sinew) German \u0027sehne\u0027 (tendon, cord, sinew) Swedish \u0027sena\u0027 (sinew) Icelandic \u0027sin\u0027 (tendon) Latin \u0027nervus\u0027 (sinew, nerve, tendon) Ancient greek (to 1453) \u0027νεῦρον\u0027 (tendon, cord, nerve) Avestan \u0027\u0027 () Sanskrit \u0027\u0027 () Tokharian b \u0027ṣñor\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cord or tendon of the body\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A nerve\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Muscle; nerve; nervous energy; vigor; vigorous strength; muscular power\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A string or chord, as of a musical instrument\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"That which gives strength or in which strength consists; a supporting member or factor; mainstay; source of strength (often plural\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The portion and \u0027\u0027sinew\u0027\u0027 of her fortune, her marriage dowry\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Raleig\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The bodies of men, munition, and money, may justly be called the \u0027\u0027sinews\u0027\u0027 of war\", \"priority\":9}]}, \"synonyms\":{}}");

	add("sinecure", "{\"term\":\"sinecure\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027sine\u0027 (without) + \u0027cūrā\u0027 (care) in \u0027\u0027 (beneficium sine cūrā)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A position that requires no work but still gives an ample payment; a cushy job\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Michael O\u0027Connor, \u0027Quadrant\u0027, November 2009, No. 461 (Volume LIII, Number 11), Quadrant Magazine Limited, page 25\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the ADF, while the numbers vary between the individual services and the reserves, employment is no comfortable \u0027\u0027sinecure\u0027\u0027 for any personnel and thus does not appeal to many people, male or female, especially under current pay scales\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Mungo MacCallum, \u0027The Monthly\u0027, April 2010, Issue 55, The Monthly Ptd Ltd, page 28\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"However, by the time of World War II (if not before), politics, at least in the federal sphere, was no longer regarded as \u0027\u0027sinecure\u0027\u0027 for well-intentioned part-timers\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A lucrative \u0027\u0027sinecure\u0027\u0027 in the Excise\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An ecclesiastical benefice without the care of souls\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Ayliffe, Universal Dictionary of Science, page [http://books.google.co.uk/books?id\u003ddHVMAAAAMAAJ\u0026amp;pg\u003dPA402\u0026amp;lpg\u003dPA402\u0026amp;dq\u003dayliffe+sinecure\u0026amp;source\u003dbl\u0026amp;ots\u003djA_VFSfaav\u0026amp;sig\u003ddwN6nLf_FeHK6MCVzQSD0hUsxBI\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dqNXRUYXcD4KS0QXiy4HwCQ\u0026amp;ved\u003d0CEMQ6AEwB\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dayliffe%20sinecure\u0026amp;f\u003dfalse 402\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A sinecure is a benefice without cure of souls\", \"priority\":11}]}, \"synonyms\":{}}");

