	add("singlefoot", "{\"term\":\"singlefoot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|single|foot|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A horse\u0027s gait, a cross between a pace and a trot, in which the two legs of one side are raised almost but not quite simultaneously\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1930\u0027\u0027, William Faulkner, \u0027As I Lay Dying\u0027, Library of America, 1985, p.69\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A mile further along he passes us, the horse, archnecked, reined back to a swift \u0027\u0027singlefoot\", \"priority\":3}]}, \"synonyms\":{}}");

