	add("singleism", "{\"term\":\"singleism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Alice Steinbach, \u0026quot;[http://articles.baltimoresun.com/1993-02-18/features/1993049099_1_janet-reno-souter-attorney-general Singles are suspect to those who divide the world by twos]\u0026quot;, \u0027The Baltimore Sun\u0027, 18 February 1993\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"But the sad truth is that even Janet Reno\u0027s description of herself as \u0026quot;an awkward old maid\u0026quot; buys into the myth of the never-married eccentric. That\u0027s how deep \u0027\u0027singleism\u0027\u0027 goes\", \"priority\":2}]}, \"synonyms\":{}}");

