	add("sinomenine", "{\"term\":\"sinomenine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An alkaloid found in the climbing plant \u0027Sinomenium acutum\u0027, native to Japan and China, traditionally used in herbal medicine as a treatment for rheumatism and arthritis\", \"priority\":1}]}, \"synonyms\":{}}");

