	add("sinophobia", "{\"term\":\"sinophobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|Sino|phobia|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A consistent hostility toward people of Chinese origin or toward Chinese culture, people, history, or government\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Fear or dislike of Chinese-made goods\", \"priority\":2}]}, \"synonyms\":{}}");

	add("sinopia", "{\"term\":\"sinopia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian \u0027sinopia\u0027 Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A reddish-brown ochre-like pigment, derived from sinople, used in traditional oil painting and as the cartoon for frescos\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The rough sketch (executed in sinopia) which underlies a fresco\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Joseph Reese Strayer, \u0027Dictionary of the Middle Ages\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Today many of the \u0027\u0027sinopias\u0027\u0027 have been uncovered by a method called stacco\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Edwin Mullins, \u0027The Popes of Avignon\u0027, Blue Bridge 2008, p. 89\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In the course of lifting the frescoes from the walls the restorers discovered Simone\u0027s full-scale working drawings (in red chalk made from iron oxide and known as \u0027\u0027\u0027sinopie\u0027\u0027\u0027) which lay directly beneath the painted plaster\", \"priority\":6}]}, \"synonyms\":{}}");

	add("sinter", "{\"term\":\"sinter\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"From German \u0027sinter\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An alluvial sediment deposited by a mineral spring\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027 June, John Magens Mello, \u0027s:Popular Science Monthly/Volume 23/June 1883/Quartz: its Varieties and Quartz: its Varieties and Formation\u0027, in \u0027w:Popular Science Popular Science Monthly\u0027, Volume 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That water at a high temperature can hold quartz in solution is well illustrated by the deposits of silicious \u0027\u0027sinter\u0027\u0027, thrown down by thermal springs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, David Paul Gooding, \u0027s:Picturesque New Zealand/Chapter Picturesque New Zealand\u0027, Chapter V\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It has steaming lakes, pools, and streams, healing baths and springs, acidulous basins of emerald, opal, and orange, and tinted terraces of \u0027\u0027sinter\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A mass formed by sintering\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, John Banhart, \u0027Advanced Tomographic Methods in Materials Research and Engineering\u0027, [http://books.google.com.au/books?id\u003doX6MtYRZVfkC\u0026amp;pg\u003dPA55\u0026amp;dq\u003d%22sinter%22\u0026amp;hl\u003den\u0026amp;ei\u003dEUKkTZXPG4_svQPc6_WJCg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d73\u0026amp;ved\u003d0CPICEOgBME\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sinter%22\u0026amp;f\u003dfalse page 55\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Consider a copper \u0027\u0027sinter\u0027\u0027 material with spherical \u0027\u0027sinter\u0027\u0027 particles in an early stage of the sintering process, see Fig. 3.5(a\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A mixture of iron ore and fluxes added to a blast furnace\", \"priority\":10}]}, \"synonyms\":{}}");

