	add("sinus", "{\"term\":\"sinus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027sinus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pouch or cavity in any organ or tissue, especially the paranasal sinus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A notch or depression between two lobes or teeth in the margin of an organ\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An abnormal cavity or passage such as a fistula, caused by the destruction of tissue\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A bay of the sea; a recess in the shore\", \"priority\":4}]}, \"synonyms\":{}}");

